def getNewbAuthAndCookie(user, pas):
    try:
        headers = {
            'cookie': 'ASP.NET_SessionId=xs4x53cskpaaszbejqibazwg; captcha=9964',
            "user-agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.124 Safari/537.36"
        }

        data = {
            "__EVENTTARGET": "",
            "__EVENTARGUMENT": "",
            "__VIEWSTATE": '',
            "__VIEWSTATEGENERATOR": "C2EE9ABB",
            "__EVENTVALIDATION": '',
            "ctl00$phSignContent$txtUsername": user,
            "ctl00$phSignContent$txtPassword": pas,
            "ctl00$phSignContent$txtCapt": "9964",
            "ctl00$phSignContent$btnLogin": "登录"
        }
        response = client.post("https://www.newb.me/LogIn.aspx?language=zh-CN", data=data, headers=headers, allow_redirects=False)
        newbauth = response.cookies[".NEWBAuth"]
        cookie = response.cookies["NEWB_MEMBERCOOKIE_CONTEXT_APR.USERSESSION.COOKIE"]
        return newbauth, cookie
    except:
        print("登录出错了, 重试中...")
        getNewbAuthAndCookie(user, pas)


def ReceiveAirdrop(newbauth, cookie):
    headers = {
        'cookie': 'ASP.NET_SessionId=xs4x53cskpaaszbejqibazwg; ARRAffinity=3f0df61cf3013598001f0320578325890fdf094201bd24ca3689ff8cd06e0848; captcha_regfoc=9908; language=en-US; captcha=4784; .NEWBAuth='+str(newbauth)+'; NEWB_MEMBERCOOKIE_CONTEXT_APR.USERSESSION.COOKIE='+str(cookie),
        'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.124 Safari/537.36'
    }
    data = {
        '__EVENTTARGET': 'ctl00$ctl00$ContentWrapper$content$lbtnCollectMilkDrop',
        '__EVENTARGUMENT': '',
        '__VIEWSTATE': '',
        '__VIEWSTATEGENERATOR': 'CA0B0334',
        '__EVENTVALIDATION': ''
    }
    responsee = client.get("https://www.newb.me/Default.aspx", headers=headers)
    aaa = re.findall(r'\/w.*?\"', responsee.text)
    data['__VIEWSTATE'] = aaa[0][:-1]
    data['__EVENTVALIDATION'] = aaa[1][:-1]
    responsee = client.post("https://www.newb.me/Default.aspx", data=data, headers=headers, allow_redirects=False)
    if responsee.status_code == 302:
        return "领取空投成功"
    else:
        return "领取空投失败"


app = FastAPI()


class Item(BaseModel):
    bsc: str = None


@app.post('/newb')
def post_num(request_data: Item):
    bsc = request_data.bsc
    t = time.time()

    user, pas = signup(bsc)
    if user == "error":
        return {"bsc": bsc, "data": pas}
    else:
        pass

    auth, cookie = getNewbAuthAndCookie(user, pas)

    status = ReceiveAirdrop(auth, cookie)

    res = {"bsc": bsc, "data": status, "time": int(time.time()-t)}
    return res


if __name__ == '__main__':
    import uvicorn
    client = httpx.Client(http2=True, verify=False)
    uvicorn.run(app=app, host="0.0.0.0", port=9999, workers=1)
